import React from 'react'
import NameDetails from './nameDetails';

function Namelist() {
    const names=[
        {
            id:1,
            name:"Shubham",
            age:47
        },
        {
            id:2,
            name:"Pratim",
            age:21
        },
        {
            id:3,
            name:"Abhishek",
            age:32
        }];
    const op=names.map((x)=>{
        return(
            <NameDetails x={x}/>
        )}
    );
    return (
        <div>
        {op}
        </div>
    )
}
export default Namelist;
